import axios from 'axios';
import React,{useState,useEffect} from 'react'
import './BusList.css'
import BusListContainer from './BusListContainer'


function BusList() {

    const buslist =[
        {
           "img":"",
           "busNO":"ND-1232",
           "RouteNo":"17",
           "From":"Colombo",
           "To":"Warakapola",
           "FromTime":"1:00 PM",
           "ToTime":"5:00PM"
        },
        {
           "img":"",
           "busNO":"ND-1455",
           "RouteNo":"17",
           "From":"Nuwara",
           "To":"Warakapola",
           "FromTime":"1:00 PM",
           "ToTime":"5:00PM"
        },
        {
           "img":"",
           "busNO":"ND-1454",
           "RouteNo":"17",
           "From":"Kadawatha",
           "To":"Warakapola",
           "FromTime":"1:00 PM",
           "ToTime":"5:00PM"
        }
       ];
       const [buses, setbuses] = useState([])
       useEffect(() => {
         axios.get(`http://localhost:8989/api/timetable/get_select_time_row/Colombo/Warakapola`)
         .then(res => setbuses(res.data))
       }, [])
       console.log(buses)
       
  return (

    <>
    <div className='container border my-4'>
        <h1 className='my-2'>Bus List</h1>
    </div>
    <div className='container border bg-light text-dark '>
        {buses.map((bus,index)=>{
            return(<BusListContainer key={index}
                          img={""}
                          busNO={bus.busNO}
                          RouteNo={bus.RouteNo}
                          From={bus.From}
                          To={bus.To}
                          FromTime={bus.FromTime}
                          ToTime={bus.ToTime}/>)
        })}
    </div>
    </>
  )
}

export default BusList
